Instagram: /angloid\nFacebook: /segashi\nWebsite: https://www.hotelsfilmed.com/\n\nIn this video, the viewer takes a journey throughout the hotel, like an invisible person. He will explore the hotel form secret angels, often hidden to an ordinary guest. He will notice little details that make each stay at Kempinski unforgettable.\n\nPlease visit www.hotelsfilmed.com if you want to know more about video production for hotels. You can contact me on the website or via my Instagram www.instagram.com/angloid\n\nBelow you can find my approach as a producer for this particular film.\n\nThe hotel has required a promotional video to maintain brand awareness. Baltschug is the first purposely built hotel in Moscow.\n\nAt the pre-production stage, we sent our treatment for approval to the hotel's marketing team. Having this agreed, we confirmed the schedule involving different hotel departments (Food and Beverage, Housekeeping, Front Desk, etc). This has allowed the production goes smoothly and to complete the filming within 2 days.\n\nThe property operates by Kempinski, Europes oldest luxury hotel group. Therefore, each and every shot was carefully thought out to adhere to the highest brand standards.","commandRuns":[{"startIndex":265,"length":13,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCEQ040EGAQiEwjysbTB3vyDAxWA0KACHYK8B35ImrTK8uf7it_OAQ==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa3gwQkdhRFJwYlFuTHcxNVl3OFdqRHhCOFFHQXxBQ3Jtc0trQkxzSTRRZWpQRmJha01MOU1iaUIyQzRSUHk2X0htYnFqZmRnbDVDTXNvQU1XUVVkUGp1aVRWUXdxUWswMHVaUkR6MGM2Q3hJdmJNd1Z6UlBBeC1KT1RveGxQNWJHcUdNWjFFRXJXNTV1Nm5yX3JBcw\u0026q=https%3A%2F%2Fwww.instagram.com%2Fangloid%2F\u0026v=zr4r3n5Smho","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa3gwQkdhRFJwYlFuTHcxNVl3OFdqRHhCOFFHQXxBQ3Jtc0trQkxzSTRRZWpQRmJha01MOU1iaU
